 to_achievement_re_restitutor_orbis_title:0 "Re-Restitutor Orbis"
 to_achievement_re_restitutor_orbis_description:0 "Restore the borders of the Roman Empire at its greatest extent before the Age of Absolutism."
 to_achievement_completed_re_restitutor_orbis_description:0 "§gI own a Gladius for home defence since that’s what the founders of Rome intended. Four plebeians break into my home. "By Jove!" I replace my Toga with a Galea and grab my Pila and Gladius. I leave a golf ball-sized wound in the first man, he’s dead on the spot. Throw my other Pilum at the second man, miss him entirely because he is too far and nail the neighbour's dog. I have to resort to the Onager at the top of the stairs loaded with pots of Greek Fire, "Roma Invicta!" As the Greek Fire burns two men to a crisp, the roaring sound and out-of-control fire sucks up all the oxygen. Strap my Scutum to my arm and charge the last terrified plebeian. He bleeds out waiting for the guards to arrive since Gladius's wounds are impossible to stitch up. Ahh~ Just as the founders of Rome intended.§!"
 to_achievement_re_restitutor_orbis_long_description:0 "[Root.ToAchievements_checkIronman][Root.ToAchievements_checkDifficulty]\n§RWe will no longer be able to complete the achievement if any of the following is true:§!\n[Root.ToAchievements_FullCondition_to_is_not_elysia_or_rhomania][Root.ToAchievements_to_is_age_of_absolutism]We are in the §YAge of Absolutism§!.\n\n§GThe achievement will be completed once all of the following is true:§!\n[Root.ToAchievements_to_controls_all_former_roman_empire_land]Has reconquered all of the provinces once owned by the Roman Empire. The required provinces can be highlighted using §Y£icon_achievement£Re-Restitutor Orbis Status§! decision, which can be enabled by pressing the toggle decision button on the achievement entry.\n\n"
 to_show_achievement_provinces_decision_re_restitutor_orbis_tt:0 "Enables §Y£icon_achievement£Re-Restitutor Orbis Status§! decision, which we can use to highlight the provinces still required to complete the achievement."
 to_hide_achievement_provinces_decision_re_restitutor_orbis_tt:0 "Disables §Y£icon_achievement£Re-Restitutor Orbis Status§! decision."
 to_achievement_provinces_decision_re_restitutor_orbis_title:0 "£icon_achievement£Re-Restitutor Orbis Status"
 to_achievement_provinces_decision_re_restitutor_orbis_desc:0 "Province highlight shows the provinces that don't yet meet the conditions for §YRe-Restitutor Orbis§! achievement."
 to_achievement_re_restitutor_orbis_province_decision_button_tooltip:0 "[Root.ToAchievements_show_province_decision_tooltip_re_restitutor_orbis]"
 to_achievement_byzantine_blitz_title:0 "Byzantine Blitz"
 to_achievement_byzantine_blitz_description:0 "Complete the entire mission tree before 1700."
 to_achievement_completed_byzantine_blitz_description:0 "§gA glimpse of the future, new tactics from tech\nNew doctrine of stackwipe explored\nAs fast as speed 5, there's no time to pause\nA glimpse of the future and the Byzantine Blitz is born§!"
 to_achievement_byzantine_blitz_long_description:0 "[Root.ToAchievements_checkIronman][Root.ToAchievements_checkDifficulty]\n§RWe will no longer be able to complete the achievement if any of the following is true:§!\n[Root.ToAchievements_FullCondition_to_is_not_elysia_or_rhomania][Root.ToAchievements_to_is_1700_and_success_conditions_were_not_met]It is the §Y1st of January 1700§! and we have NOT yet completed the achievement's objective.\n\n§GThe achievement will be completed once all of the following is true:§!\n[Root.ToAchievements_to_has_completed_entire_elysian_mission_tree]Has completed every mission in the §Y[Root.GetAdjective]§! mission tree.\n\n"
